import React from 'react';
import styles from "./Gallery.module.scss";

const Gallery = props => {

  const project = props.project;

  return <div className={styles.main}>
    <h1>{project.name}</h1>
    <ul>
        {project.points.map(point => <li key={point}>{point}</li>)}
    </ul>
    <img src="../resi"/>
  </div>
}

export default Gallery;
